import React from "react";
import "../App.css";

export default function ContactUs() {
  return (
    <div>
      <div className="container">
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}
